export const questions = [
  {
    title: "Яким заклинанням Гаррі вбив лорда Волдеморта?",
    variants: ["Експеліармус", "Авада Кедавра", "Акціо", "Патронус"],
    correct: 0,
  },

  {
    title:
      "На першому засіданні дуель-клубу Драко Малфой викликав яку тварину заклинанням «Serpensortia»?",
    variants: ["Жаба", "Змія", "Дракон", "Жаба"],
    correct: 1,
  },

  {
    title: "Заклинання 'Феліфорс' перетворює кота на що?",
    variants: ["Капелюх", "Матч-скринька", "Котел"],
    correct: 2,
  },

  {
    title: "Який елемент асоціюється з Хаффлпаффом?",
    variants: ["Пожежа", "Земля", "Вода"],
    correct: 1,
  },

  {
    title: "Яку позицію відіграє Гаррі у своїй команді з квідичу?",
    variants: ["Блуджер", "Переслідувач", "Шукач"],
    correct: 2,
  },

  {
    title:
      "Хто нокаутує троля в жіночій ванній в Гаррі Поттері та Філософському камені?",
    variants: ["Гаррі", "Герміона", "Рон"],
    correct: 2,
  },
];
